import styled from '@emotion/styled';

const ImgContainer = styled.div`
  width: 100%;
  position: relative;
`;

const Img = styled.img`
  width: 100%;
  height: auto;

  object-fit: cover;
`;

const Title = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-top: 15px;
  margin-bottom: 15px;
`;

const ModalContent = (
  carClassId,
  image,
  carClassName,
  maker,
  carModel,
  fuel,
  gearbox,
  capacity,
  safetyOption,
  additionalOption,
) => {
  return (
    <div>
      <Title>{carClassName}</Title>
      <h2>{safetyOption}</h2>
    </div>
  );
};

export default ModalContent;
